window.bookSummaryJSON = "<p>Sherman Holmes has officially settled into his new city, and the World's Greatest Detective Agency has opened its doors. While his put-upon partner, Watson, would be happy to keep the jobs as simple as missing pets, when a worried worker with an outlandish tale of ghosts walks in, there's no stopping Sherman from taking the case.</p> <p>Now, the new duo must investigate a local \"haunted\" tourist site where the scares are going off-script and otherworldly interference is suspected. With Sherman lost in the history of the mystery, Watson finds himself needing to adapt quickly to his new job's unique challenges.</p> <p>Facing booby-trapped halls to navigate, pesky former coworkers popping in without warning, and growing attention from a local criminal element, even an operative of Watson's talents is going to need some help getting through this case alive.</p> <p>Instead, he has Sherman Holmes.&nbsp;</p>"; 
